import React,{useState} from 'react'
import ReactDOM from 'react-dom';
import './portfolio.css';

function portfolio() {
    return (
        <div className="row">
           <div className="col-1">
                <a href="" class="btn "><i class="fab fa-btc btc__link"></i> Jump start your portfolio &#8594;</a>
                <h1>Jump start<br></br> your crypto<br></br>portfolio</h1>
                <div>
                    <p>Coinbase is the easiest place to buy and sell <br>
                    </br>cryptocurrency. Sign up and get started today.</p> 
                </div>
                <div>
                    <form className="address">
                        <input placeholder="Email address" name="email"></input>
                    </form>
                </div>
            </div>
        </div>
    );
}

export default portfolio;
